import React from 'react';
import './App.css';
import Order from './Order';

class App extends React.Component {
  render() {
    const headphone = {
      id: 102,
      user: "cena@gmail.com",
      product: "Razer Headphone",
      price: {
        value: 99.99,
        currency: "dollars"
      }
    };

    const energyDrink = {
      id: 77,
      user: "cena@gmail.com",
      product: "Monster 500mL",
      price: {
        value: 9.99,
        currency: "dollars"
      }
    };

    return (
      <div className="App">
        <h1> Orders recently created </h1>
        < Order user={ headphone } product={ headphone } value={ headphone.price } currency={ headphone.price } />
        < Order user={ energyDrink } product={ energyDrink } value={ energyDrink.price } currency={ energyDrink.price } />
      </div>
    );
  }
}

export default App;
